The Ultimate Tour was the first time that Take That had performed together since they split in 1996. The show featured all the original members of the group, except Robbie Williams who quit the group in 1995. At a press conference in London on November 25, 2005 the group front man Gary Barlow announced: &quot;Thanks for giving us the last 10 years off but unfortunately the rumours are true. Take That are going back on tour.&quot; The news came after renewed interest in the group after a televised documentary proved to be a ratings success and their album Never Forget: The Ultimate Collection peaked at #2 in the UK Albums Chart. The tour was originally scheduled to be an 11 date arena tour but after they sold out within 30 minutes of going on sale, more dates were immediately added as promoters doubled the number of shows. The group sold 275,000 tickets in the space of under 3 hours, ironically making it the second fastest tour of 2005 behind former member Robbie Williams' solo tour.



